import React from "react";

const CataloguePage = () => {
  return (
    <div style={{ padding: 40 }}>
      <h1>TEST IMAGE</h1>

      <img
        src="/assets/images/aloe_first_spray.jpg"
        alt="test"
        style={{ width: 200 }}
      />
    </div>
  );
};

export default CataloguePage;
